import React from 'react';

import './SecondPanel.css';
import Illustration from './Illustration';

const SecondPanel = () => {
  return (
    <div className='talldiv'>
      <div className='SecondPanel-container'>
        <div className='SecondPanel-text-container'>
          <div className='SecondPanel-text'>
            The greatest computer scientist since Charles Babbage
          </div>
          <div className='SecondPanel-secondary-text'>
            Some have asked me how I got so good so fast. Some have assked me
            what the method to my success is. Well here I am to lay aside all
            the secrets and tell you once and for all how I got so good:
            SOYLENT. That shit saves so much times its insane
          </div>
        </div>
        <div className='SecondPanel-hack'>
          <Illustration />
        </div>
      </div>
      <div className='SecondPanel-center'>
        <div className='SecondPanel-center-primary'>Thats not all</div>
        <div className='SecondPanel-secondary-text'>
          I also made a meme once and it got like 100 views. kinda crazy
        </div>
      </div>
    </div>
  );
};

export default SecondPanel;
